import React from 'react';
import { NavLink } from "react-router-dom";

import "../css/Principal.css";
import tierra from "../img/tierra_GIF_01.gif";

function Principal() {
  return (
    <React.Fragment>
      <div className='content_principal'>
        <NavLink to={"/home"}>
          <div className='boton_entrar'>
            <span className=''>ENTRAR</span>
            <img className='tierra' src={tierra}/>
          </div>
        </NavLink>
      </div>
    </React.Fragment>
  )
}

export default Principal;
